import React, { useState } from "react";

function Counter() {
  const [count, setCount] = useState(0);
  // console.log(setCount(1));

  return (
    <div>
      <p>count: {count}</p>
      <button type="asdf" onClick={() => setCount(count + 1)}>+</button>
    </div>
  );
}

export default Counter;
